import React from "react";
import { AppBar, Toolbar } from "@material-ui/core";
// #
// ff530d
const Header = () => {
  return (
    <AppBar position="sticky" style={{ background: "#ff530d"}}>
    <Toolbar 
        style={{
          alignSelf: "flex-start",
          backgroundColor: "#33FF9C",
        }}>
      &nbsp;&nbsp;
      <h1>Country search</h1>
    </Toolbar>
  </AppBar>
  );
};

export default Header;
